import fetcher from "./fetcher";
import axios from "axios";

const api = {

    async getLastFourApartments(){
        try{
            const data = await axios.get(`http://localhost:5000/apartments/fourLastApartmentsBydate`);
            return data
        }  catch (error) {
            console.log(error);
        }
    },

    async getfilteredApartments(filtered){
        try{
            const data = await axios.get(`http://localhost:5000/apartments?${filtered}`);
            return data
        }  catch (error) {
            console.log(error);
        }
    },

    async loginUser(userData){
        try{
            const data = await fetcher.post(`/login`, userData);
            // console.log(data);
        }  catch (error) {
            console.log(error);
        }
    },

    async SignupUser(userData){
        try{
            const data = await fetcher.post(`/signup`, userData);
            // console.log(data);
        }  catch (error) {
            console.log(error);
        }
    },

    async getCitiesListByCountry(country){
        try{
            const data = await fetcher.get(`/citiesByCountry`, country);
            return data;
            // console.log(data);
        }  catch (error) {
            console.log(error);
        }
    },

    async getCitiesName(){
        try{
            const data = await fetcher.get(`/cities`);
            return data;
            // console.log(data);
        }  catch (error) {
            console.log(error);
        }
    },

    async AddNewApartment(newApartmentData){
        console.log(newApartmentData);
        try{
            const data = await fetcher.post(`/apartments/addApartment`, newApartmentData);
            // console.log(data);
        }  catch (error) {
            console.log(error);
        }
    }

};

export default api;
